import React from 'react';
import { 
  LineChart, 
  Line 
} from 'recharts';

const MyLineChart = (props) => {

  return (
    <LineChart
      width={640}
      height={480}
      data={props.data}
    >
      <Line type="monotone" dataKey="engagement_level" stroke="#8884d8" />
    </LineChart>
  );
};

export default MyLineChart;
